import React from 'react';
import { useSelector } from 'react-redux';
import { NavLink } from 'react-router-dom';
import styles from './Form.module.css';
import Navbar from './Navbar';
import Footer from './Footer';
import FormCalendar from './FormCalendar';
import { fullWeek} from '../Functions/Calendar';
import closeImage from '../img/bxs-x-circle.svg';
import { useState } from 'react';

export default function Form() {
    const j = useSelector(state => state.j);
    const doctors = useSelector(state => state.renderDoctors);
    const [modalidad, setModalidad] = useState('');
    const [horasElegidas, setHorasElegidas] = useState([]);
    const [_horasElegidas, set_HorasElegidas] = useState([]);

    function handleClick(e) {
        e.preventDefault();
        setModalidad(e.target.name);
    }

    function horas() {
        let array = [];
        let minutes = ['00', '20', '40'];
        let g = 8;
        while (g < 20) {
            for (let i = 0; i < minutes.length; i++) {
                array.push(`${g}:${minutes[i]}`)
            }
            g++;
        }
        return array;
    }

    function handleHour(e) {
        e.preventDefault();
        const hora = e.target.name;
        if(!horasElegidas.includes(hora)) {
            setHorasElegidas([...horasElegidas, hora]);
            /* const formatHora = Number(hora.split(':').join(''));
            set_HorasElegidas([..._horasElegidas, formatHora]);
            let sort = _horasElegidas.sort(compareNumbers);
            sort = sort.map(h => h.toString());
            const newSort = sort.map(h =>{
                if (h.length < 4) return `${h[0]}:${h[1]}${h[2]}`;
                else return `${h[0]}${h[1]}:${h[2]}${h[3]}`;
            })
            let result = newSort.filter((item,index)=>{
                return newSort.indexOf(item) === index;
            })
            setHorasElegidas(result); */
        }
        else {
            const horasFiltradas = horasElegidas.filter(h => h !== hora);
            setHorasElegidas(horasFiltradas);
        }
    }

    function compareNumbers(a, b) {
        return a - b;
    }

    return (
        <div className={styles.bigContainer}>
            <Navbar />
            <form className={styles.container}>
                <div>
                    <div className={styles.formulario}>
                        <NavLink to='/main' className={styles.close}>
                            <img src={closeImage} alt="" />
                        </NavLink>
                        <div className={styles.nombre}>
                            <div className={styles.section}>
                                <label htmlFor="">Nombre:</label>
                                <input type="text" />
                            </div>
                            <div className={styles.section}>
                                <label htmlFor="">Subir imagen:</label>
                                <i id={styles.addMiniImage} class='bx bxs-file-plus'></i>
                                <i id={styles.addImage} class='bx bx-plus'></i>
                            </div>
                        </div>
                        <div className={styles.section}>
                            <label htmlFor="">Género:</label>
                            <input type="text" />
                        </div>
                        <div className={styles.section}>
                            <label htmlFor="">Especialidad:</label>
                            <input type="text" />
                        </div>
                        <div className={styles.section}>
                            <label htmlFor="">Convenio:</label>
                            <input type="text" />
                        </div>
                        <div className={styles.section}>
                            <label htmlFor="">Lugar(Comuna):</label>
                            <input type="text" />
                        </div>
                        <div className={styles.section}>
                            <label htmlFor="">Ubicación(Centro Médico):</label>
                            <input type="text" />
                        </div>
                        <div className={styles.section}>
                            <label htmlFor="">Modalidad:</label>
                            <div className={styles.modalidad}>
                                <div className={styles.section}>
                                    <button name='presencial' onClick={handleClick} id={modalidad === 'presencial' ? styles.buttonOnn : ''}>Presencial</button>
                                </div>
                                <div className={styles.section}>
                                    <button name='online' onClick={handleClick} id={modalidad === 'online' ? styles.buttonOnn : ''}>Online</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div className={styles.horarioContainer}>
                    <h1 className={styles.h1}>Horario</h1>
                    <div className={modalidad !== '' ? styles.calendarOnn : styles.calendarOff}>
                        <FormCalendar characters={doctors} fullWeek={fullWeek(j)} />
                        <div className={styles.horas}>
                            {horas().map(hora => {
                                return <button onClick={handleHour} name={hora} id={horasElegidas.includes(hora) ? styles.horaOnn: ''} className={modalidad === 'presencial' ? styles.presenciales : styles.online}>{hora}</button>
                            })}
                        </div>
                    </div>
                </div>
                <button onClick={e => {e.preventDefault()}} className={styles.submit}>Crear</button>
            </form>
            <Footer />
        </div>
    )
}
